import React from 'react'

export default function CreatePage() {

    function renderInput(name, label, type){
        return (
            <div>
                <label>{label}</label>
                <input type={type || "text"}name={name}/>
                <br/>
            </div>
        )
    }
    return (
        <div>
            <form>
                {renderInput("name", "Organisation Name")}
                {renderInput("name", "Organisation Number", "email")}
                {renderInput("name", "VAT number")}
                {renderInput("name", "Reference")}
                {renderInput("name", "Payment Term")}
                {renderInput("name", "Payment Term")}
                {renderInput("name", "Email")}
                {renderInput("name", "Phone Number")}
            </form>
        </div>
    )
}
